    [],nt"revision_timestamp": "2016-07-27T23:02:35.706792",nt"name": "nowitna-nwr-duck-production-survey-1988",nt"isopen":
    false,nt"url": null,nt"notes": "This report summarizes the results of a
    duck production survey that was conducted on the Nowitna National Wildlife Refuge
    in 1988. The survey employed a stratified random sampling design to sample a total
    of 463wetlands in five geographic strata. Accessible wetlands were surveyed by walking
    or canoeing: inaccessible wetlands were surveyed from a helicopter. Totals of 360
    and 531 broods were observed during the early and late surveys, respectively. Dabbling
    duck broods were observed most frequently, accounting for 84% of all broods observed
    in the early survey and 80% in the late survey. American wigeon broods were the
    most commonly observed of all species, followed by northern pintail, green-winged
    teal and mallard broods. Scaup broods were principal among diving duck species.
    Survey methods, data analysis, and results are discussed. Study area maps and data
    forms are included.",nt"license_title": "License Not Specified",nt"extras":
